const randomize = function (range) {
    return Math.floor(Math.random() * range);
}

const getRace = function () {
    let selectedRace = document.getElementById("selectRace").selectedIndex;
    return document.getElementsByTagName("option")[selectedRace].value;
}

function generateName() {
    let name = '';
    let race = getRace();
    let gender = document.getElementById("selectGender").value;

    if (race === "Altmer" && gender === "Male") {
        name = altmerNameMale[randomize(altmerNameMale.length)];
    }
    else if (race === "Altmer" && gender === "Female") {
        name = altmerNameFemale[randomize(altmerNameFemale.length)];
    }

    else if (race === "Bosmer" && gender === "Male") {
        name = bosmerNameMale[randomize(bosmerNameMale.length)];
    }
    else if (race === "Bosmer" && gender === "Female") {
        name = bosmerNameFemale[randomize(bosmerNameFemale.length)];
    }

    else if (race === "Dunmer" && gender === "Male") {
        name = dunmerNameMale[randomize(dunmerNameMale.length)];
    }
    else if (race === "Dunmer" && gender === "Female") {
        name = dunmerNameFemale[randomize(dunmerNameFemale.length)];
    }

    else if (race === "Orsimer" && gender === "Male") {
        name = orsimerNameMale[randomize(orsimerNameMale.length)] + " gro-" + orsimerSurname[randomize(orsimerSurname.length)];
    }
    else if (race === "Orsimer" && gender === "Female") {
        name = orsimerNameFemale[randomize(orsimerNameFemale.length)] + " gra-" + orsimerSurname[randomize(orsimerSurname.length)];
    }

    else if (race === "Nord" && gender === "Male") {
        name = nordNamesMale[randomize(nordNamesMale.length)];
    }
    else if (race === "Nord" && gender === "Female") {
        name = nordNameFemale[randomize(nordNameFemale.length)];
    }

    else if (race === "Redguard" && gender === "Male") {
        name = redguardNameMale[randomize(redguardNameMale.length)];
    }
    else if (race === "Redguard" && gender === "Female") {
        name = redguardNameFemale[randomize(redguardNameFemale.length)];
    }

    else if (race === "Breton" && gender === "Male") {
        name = bretonNameMale[randomize(bretonNameMale.length)];
    }
    else if (race === "Breton" && gender === "Female") {
        name = bretonNameFemale[randomize(bretonNameFemale.length)];
    }

    else if (race === "Imperial" && gender === "Male") {
        name = imperialNameMale[randomize(imperialNameMale.length)];
    }
    else if (race === "Imperial" && gender === "Female") {
        name = imperialNameFemale[randomize(imperialNameFemale.length)];
    }

    else if (race === "Khajiit" && gender === "Male") {
        name = khajiitNameMale[randomize(khajiitNameMale.length)];
    }
    else if (race === "Khajiit" && gender === "Female") {
        name = khajiitNameFemale[randomize(khajiitNameFemale.length)];
    }

    else if (race === "Argonian" && gender === "Male") {
        name = argonianNameMale[randomize(argonianNameMale.length)];
    }
    else if (race === "Argonian" && gender === "Female") {
        name = argonianNameFemale[randomize(argonianNameFemale.length)];
    }

    else {
        name = "Smth wrong, try again";
    }

    let createdName = document.getElementById("createdName");
    createdName.innerHTML = name;
}